import React, { useEffect, useState } from 'react'
import './App.css';
import axios from 'axios';
import ListaPostaci from './components/ListaPostaci'
import { Button } from '@material-ui/core'


function App() {
  const [postaci, setPostaci] = useState(null)

useEffect (() => {
  fetch('http://loclahost:3000/characters', {method: 'POST'})

  axios.get
  axios.p ('http://loclahost:3000/characters'). then(result => {
    console.log('result', result)
    setPostaci(result.data)
  })
}, [])


const dodajNowaPostac = ()=> {
  const example = {
    "id": 6,
    "name": "Kamil Niewazny",
    "status": "Alive",
    "species": "Human",
  }
  axios.post('http://loclahost:3000/characters', example)

}

  if (!postaci) {
    return (<div className="App">
      Brak danych z backendu
    </div>)
  }

  return (
    <div className="App">
      <button onClick={dodajNowaPostac}> Dodaj</button>
        <ListaPostaci postaci ={postaci}/>
    </div>
  );
}


export default App;
